```dockerfile
# Use an official Node.js image as a parent image
FROM node:14

# Install dependencies
RUN npm install

# Copy your Cypress project files to the container
COPY..

# Expose the port that NestJS runs on
EXPOSE 3000

# Start NestJS server
CMD ["npm", "start", "--watch", "node", "your-project-name.js"]
